import React from 'react';
import Fall from './images/fall.jpg';

const SeasonDisplay = () => {
	return (
		<div style={{ height: 200, width: 200, backgroundImage: Fall, textAlign: 'center' }}>
			<p>SeasonDisplay</p>
		</div>

	);
};

export default SeasonDisplay;
